package hrd_score.vo;

public class AverageVo {
	private int count;
	private double avg;
	
	public AverageVo() {
		// TODO Auto-generated constructor stub
	}
	
	public AverageVo(int count, double avg) {
		this.count = count;
		this.avg = avg;
	}

	public int getCount() {
		return count;
	}
	public double getAvg() {
		return avg;
	}
	
	
}
